# 2419. Longest Subarray With Maximum Bitwise AND
# You are given an integer array nums of size n.
# Consider a non-empty subarray from nums that has the maximum possible bitwise AND.
# In other words, let k be the maximum value of the bitwise AND of any subarray of nums. 
# Then, only subarrays with a bitwise AND equal to k should be considered.
# Return the length of the longest such subarray.
 
# Example 1:
# Input: nums = [1,2,3,3,2,2]
# Output: 2
# Explanation:
# The maximum possible bitwise AND of a subarray is 3.
# The longest subarray with that value is [3,3], so we return 2.
# Example 2:
# Input: nums = [1,2,3,4]
# Output: 1
# Explanation:
# The maximum possible bitwise AND of a subarray is 4.
# The longest subarray with that value is [4], so we return 1.
 

# Constraints:
# 1 <= nums.length <= 105
# 1 <= nums[i] <= 106


import bisect
from typing import List



class Solution:
    def longestSubarray(self, nums: List[int]) -> int:
        largest_num = max(nums)
        max_range = 1
        for i in range(len(nums)):
            if nums[i] == largest_num :
                cnt = 0
                while i < len(nums) and nums[i] == largest_num :
                    cnt += 1
                    i   += 1
                max_range = max(max_range, cnt)
        return max_range
    

        
